textOriginal:
Tenho receios quanto a proibição de um juiz se manifestar:
1. Sua posição política fica invisível;
2. Fica difícil de alguém prejudicado obter provas;
3. Significa a validação da censura seletiva.
Ao mesmo tempo, o que se vê no laís é um flagrante desrespeito a Constituição e as Normas Jurídicas. Flagrantes crimes que atingem até mesmo figuras poderosas.
Precisamos de uma resposta do Congresso Nacional, urgente!
